import '../../css/Main.css';
import InitialImage from '../../images/InitialImage.jpg';
import FormSection from './FormSection.js';

function Main() {
    return(
        <div className="Main">
            <div className="MainLeftPanel">
                <div className="InitialImage"> <img src={InitialImage} alt="InitalLoad"/> </div>
            </div>
            <div className="MainRightPanel"> 
                <div className="InitialImage"> <img src={InitialImage} alt="InitalLoad"/> </div>
            {/* <div className="FormSection"> <FormSection/> </div>*/}
            </div>

        </div>
    );
}
export default Main;
